(function ( $ ) {

  $.fn.instaEffects = function( options ) {

    // presets
    var presets = ['original', 'ninetensevenseven', 'brannan', 'gotham', 'hefe', 'lordkelvin', 'nashville', 'xpro'], i = 0, InstaToggleBusy = false, presetBusy = false;

    // wrap the image
    this.each( function() {
      var $this = $(this);
        $this.wrap('<div class="insta-image"></div>');
    });

    // wrap the insta-image class
    this.closest('.insta-image').each(function(n){

      var $this = $(this),
        img = $this.find('img'),
        src = img.attr('src');
        $this.find('> img').wrap('<div class="insta-image-inner"></div>').attr('id', 'caman-image-' + i);
        $this.prepend('<div class="insta-wrap"><ul class="insta-filters"><li class="active"><a href="#" data-preset="original"><img src="'+src+'" id="'+presets[0]+ "-" + i +'" alt="original"></a></li><li class="canvas-preset"><a href="#" data-preset="ninetensevenseven"><img src="'+src+'" id="'+presets[1]+ "-" + i +'" alt="ninetensevenseven" class="filter" data-filter="ninetensevenseven"></a></li><li class="canvas-preset"><a href="#" data-preset="brannan"><img src="'+src+'" id="'+presets[2]+ "-" + i +'" alt="brannan" class="filter" data-filter="brannan"></a></li><li class="canvas-preset"><a href="#" data-preset="gotham"><img src="'+src+'" id="'+presets[3]+ "-" + i +'" alt="gotham" class="filter" data-filter="gotham"></a></li><li class="canvas-preset"><a href="#" data-preset="hefe"><img src="'+src+'" id="'+presets[4]+ "-" + i +'" alt="hefe" class="filter" data-filter="hefe"></a></li><li class="canvas-preset"><a href="#" data-preset="lordkelvin"><img src="'+src+'" id="'+presets[5]+ "-" + i +'" alt="lordkelvin" class="filter" data-filter="lordkelvin"></a></li><li class="canvas-preset"><a href="#" data-preset="nashville"><img src="'+src+'" id="'+presets[6]+ "-" + i +'" alt="nashville" class="filter" data-filter="nashville"></a></li><li class="canvas-preset"><a href="#" data-preset="xpro"><img src="'+src+'" id="'+presets[7]+ "-" + i +'" alt="xpro" class="filter" data-filter="xpro"></a></li></ul></div>');
        i++;
    });

    // prepend the insta toggle
    this.closest('.insta-image-inner').prepend('<a href="#" class="insta-toggle">Add Insta Effects</a>');

    // tweenmax initialization
    var  tl = new TimelineLite();
    tl.set('.insta-filters li', {autoAlpha:0}); 
    tl.set('.insta-wrap .insta-filters li', {height:0});

    // click event for insta toggle
    var instaToggle = function() {
      $('body').on('click', '.insta-toggle', function(e){

        var $this = $(this),
          instaFilters = $this.closest('.insta-image').find('.insta-filters li'),
          imgHeight = $this.closest('.insta-image').find('.insta-filters li').first().find('> a > img').outerHeight();

        if (InstaToggleBusy) {
          return;
        }

        var src = $this.closest('.insta-image').find('.insta-filters li').first().find('img').attr('src'),
					str =	src.substr(0,10);

				if ( str != 'data:image' ) {
        	instaFilters.find('img').filterMe();
        }

        if  ( $this.closest('.insta-image').hasClass('active') ) {
          $this.closest('.insta-image').removeClass('active');

        } else {
          $this.closest('.insta-image').addClass('active');
          
        }

        InstaToggleBusy = true;

        /* 
        	Add setTimeout to avoid 
        	flickering of animation 
        */
        setTimeout(function(){

	        if ( !$this.hasClass('active') ) {
	          tl.set(instaFilters, { autoAlpha:1 });

	          tl.to(instaFilters, .2, { height: imgHeight + 10});

	          tl.staggerFrom(instaFilters, .5, {autoAlpha: 0, y: 20, delay:0.1, ease: Power4.easeInOut, onComplete:function(){
	            InstaToggleBusy = false;
	          }}, 0.03, '-=.2');

	          tl.to($this, .2, { width: 'auto',  ease: Power4.easeInOut });

	          $this.addClass('active');
	          $this.html('Close');

	        } else {
	          tl.staggerTo(instaFilters, .5, {autoAlpha: 0, y: 20, delay:0.1, ease: Power4.easeInOut, onComplete:function(){
	            InstaToggleBusy = false;
	          }}, 0.03);
	          
	          tl.set(instaFilters, {y:0});  
	          tl.to(instaFilters, .2, { height: 0 });

	          tl.to($this, .2, { width: 'auto',  ease: Power4.easeInOut });

	          $this.removeClass('active');
	          $this.html('Add Insta Effects');
	        }
        }, 200);
        e.preventDefault();
      });
    };
    instaToggle();

    // render the insta preset
    var renderPreset = function(camanElement, preset, presetElement, instaFilters) {
      if (presetBusy) {
        return;
      }

      instaFilters.find('li').removeClass('active');
      presetElement.closest('li').addClass('active');

      presetBusy = true;
      camanElement.revert(true);
      camanElement[preset]();
      return camanElement.render(function() {
        return presetBusy = false;
      });
    };

    // select insta filters preset (click event)
    var selectInstaEffects = function() {
      $('body').on('click', '.insta-filters li a', function(e){
        var $this = $(this), that = $this, instaFilters = that.closest('.insta-filters');

        if ( $this.closest('.insta-image').find('.insta-image-inner > img').length > 0 ) {
          var camanImage = "#" + $this.closest('.insta-image').find('.insta-image-inner > img').attr('id'); 
        } else {
          var camanImage = "#" + $this.closest('.insta-image').find('.insta-image-inner > canvas').attr('id');  
        }
        var presetCaman = Caman(camanImage);
        var preset = $this.data('preset');

        setTimeout(function(){
          if (preset != 'original') {
            renderPreset(presetCaman, preset, that, instaFilters);
          } else {
            instaFilters.find('li').removeClass('active');
            instaFilters.find('li').first().addClass('active');
            presetCaman.revert(true);
          }
        }, 100);

        e.preventDefault();
      });
    };
    selectInstaEffects();

  };  

}( jQuery ));
